import { storiesOf } from "@storybook/react-native";
import { AkIcons } from "../../index";
import { Center, NativeBaseProvider } from "native-base";

const ProviderContainer = ({ Component }) => (
  <NativeBaseProvider>
    <Component />
  </NativeBaseProvider>
);

storiesOf("Social Icons 2", module)
  .addDecorator((getStory) => (
    <ProviderContainer Component={() => <Center>{getStory()}</Center>} />
  ))
  .add("Facebook Icon", () => (
    <ProviderContainer Component={AkIcons.SocialIcons.Face} />
  ));

